public void startPutty(putty,user,password,ipaddress)
{
	Runtime run = Runtime.getRuntime();
	Process proc;

	def start = putty+" -ssh -l "+user+" -pw "+password+" "+ipaddress+"";
	try
	{
		proc = run.exec(start);								//Opening Putty Terminal
		Thread.sleep(3000);
	}
	catch (Exception e)
	{
		e.printStackTrace();
	}
	Thread.sleep(3000);
}

public void loginToSystem(env,password)
{
	Thread.sleep(1000);
	system	= "sudo su - pin"+env;
	printConsole(system);
	printConsole(password);
}

public void navigate(env)
{
	Thread.sleep(1000);
	path	= "cd pin-srv-batch/bin"
	printConsole(path);
}

public void executeBatch(batch)
{
	Thread.sleep(1000);
	batch_Command = "sh "+batch;
	printConsole(batch_Command);
	Thread.sleep(90000);
}

public void printConsole(command)
{
	Thread.sleep(500);
	Robot robot = new Robot();
	int counter=0,	holder=0;
	commandLength=command.length();

	while(counter<commandLength)
	{
		character = command.charAt(counter); command[0]
		if ((character >="0" && character <= "9") || (character >="a" && character <= "z"))
		{
			holder = (int) character;
			robot.keyPress(KeyEvent.getExtendedKeyCodeForChar(holder));
		}
		else if (Character.isUpperCase(character) || (character >="A" && character <= "Z"))
		{
			holderUpperCase =(int) character;

			robot.keyPress(KeyEvent.VK_SHIFT);
			robot.keyPress(KeyEvent.getExtendedKeyCodeForChar(holderUpperCase));
			robot.keyRelease(KeyEvent.VK_SHIFT);
		}
		else
		{
			switch (character)
			{
				case '`'	:	robot.keyPress(KeyEvent.VK_BACK_QUOTE);	break;
				case '-'	:	robot.keyPress(KeyEvent.VK_MINUS);		break;
				case '='	:	robot.keyPress(KeyEvent.VK_EQUALS);	break;

				case '['	:	robot.keyPress(KeyEvent.VK_OPEN_BRACKET);break;
				case ']'	:	robot.keyPress(KeyEvent.VK_CLOSE_BRACKET);break;
				case '\\'	:	robot.keyPress(KeyEvent.VK_BACK_SLASH);	break;

				case ';'	:	robot.keyPress(KeyEvent.VK_SEMICOLON);	break;
				case '\''	:	robot.keyPress(KeyEvent.VK_QUOTE);		break;
				case ','	:	robot.keyPress(KeyEvent.VK_COMMA);		break;

				case '.'	:	robot.keyPress(KeyEvent.VK_PERIOD);	break;
				case '/'	:	robot.keyPress(KeyEvent.VK_SLASH);		break;
				case ' '	:	robot.keyPress(KeyEvent.VK_SPACE);		break;

				case '~'	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_BACK_QUOTE);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;
				case '!'	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_1);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;

				case '@'	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_2);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;
				case '#'	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_3);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;

				case '$'	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_4);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;
				case '%'	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_5);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;

				case '^'	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_6);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;
				case '&'	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_7);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;

				case '*'	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_8);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;
				case '('	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_9);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;

				case ')'	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_0);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;
				case '_'	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_MINUS);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;

				case '+'	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_EQUALS);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;
				case '{'	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_OPEN_BRACKET);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;

				case '}'	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_CLOSE_BRACKET);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;
				case '|'	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_BACK_SLASH);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;

				case ':'	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_SEMICOLON);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;
				case '"'	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_QUOTEDBL);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;

				case '<'	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_COMMA);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;
				case '>'	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_PERIOD);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;

				case '?'	:	robot.keyPress(KeyEvent.VK_SHIFT,KeyEvent.VK_SLASH);
							robot.keyRelease(KeyEvent.VK_SHIFT);	break;
				default	:	throw new IllegalArgumentException("Cannot type character: "+character);
				//Refer https://coderanch.com/t/544719/java/Robot-symbols
			}
		}
		counter++;
		Thread.sleep(150);
	}
	robot.keyPress(KeyEvent.VK_ENTER);
	Thread.sleep(500);
}

public void exit()
{
	String exit	= "exit";
	printConsole(exit);
	printConsole(exit);
}

